import React, { useState } from 'react'

export default function Register() {


  const [form, setForm] = useState ({
    name : '',
    email : '',
    password : ''
  })

  const handleSubmit = async(e) => {
    e.preventDefault();

    try {
        const response = await axios.post(`http://localhost:5000/api/signup`,form)
        console.log("Respinse: ")
    } catch (error) {
        
    }

  }

  const handleChange = (e) => {
    setForm({...form, [e.target.name]: e.target.value})
  }


  return (
    <div>
        <div>
            <h1>Sign Up</h1>
            <form onSubmit={handleSubmit}> 
                <label>User Name : </label>
                <input type='text' placeholder='John Stev' name='username' required value={form.name} onChange={handleChange}/>

                <label>Email : </label>
                <input type='email' placeholder='abc@gmail.com' name='username' required value={form.email} onChange={handleChange}/>

                <label>Password : </label>
                <input type='password' name='password' required value={form.password} onChange={handleChange}/>

                <button>Sign Up</button>

            </form>
        </div>
    </div>
  )
}
